import math
EPS = 1.0000000001

class Point:

    def __init__(self, x, y):
        self.x = x
        self.y = y

    def __add__(self, point):
        return Point(self.x + point.x, self.y + point.y)

    def __sub__(self, point):
        return Point(self.x - point.x, self.y - point.y)

    def __mul__(self, a):
        return Point(a * self.x, a * self.y)

    def __truediv__(self, a):
        return Point(self.x / a, self.y / a)

    def __abs__(self):
        return math.sqrt(self.norm())

    def norm(self):
        return self.x ** 2 + self.y ** 2

    def __eq__(self, point):
        return abs(self.x - point.x) < EPS and abs(self.y - point.y) < EPS

def dot(a, b):
    return a.x * b.x + a.y * b.y

def cross(a, b):
    return a.x * b.y - a.y * b.x

def isOrthogonal(a, b):
    return dot(a, b) == 0

def isParallel(a, b):
    return cross(a, b) == 0

def check_line_relationship(x0, y0, x1, y1, x2, y2, x3, y3):
    a = Point(x0, y0) - Point(x1, y1)
    b = Point(x2, y2) - Point(x3, y3)
    if isOrthogonal(a, b):
        return 1
    elif isParallel(a, b):
        return 2
    else:
        return 0

